import Box from '@mui/material/Box';
import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
// import { commandOptions } from 'redis';



export default function AppDummy({

    userUrl,
    counter,
    header1,
    header2,
    updatedValue

  }) { 



    return <> 
 <TableContainer style={{paddingLeft:'700px', display: 'flex', flexDirection:'column'}} >

        <TableHead>
          <TableRow>
            <TableCell>{header1}</TableCell>
            <TableCell align="right">{header2}</TableCell>

          </TableRow>
        </TableHead>
        <TableBody>

            <TableRow
              key={userUrl}


            >
              <TableCell component="th" scope="row">
                {userUrl}
              </TableCell>
              <TableCell align="right">{updatedValue}</TableCell>

            </TableRow>

        </TableBody>

    </TableContainer>
 <h1>{updatedValue}</h1>
          </>

}
